import React from "react";
import Register
 from "./Register";

const LogIn = () => {

    const handleClick = () => {
        return <Register></Register>
    }

    return (
        <div>
        <p>Login Page</p>
        <p>Need to create an account?</p>
        <button onClick={handleClick}></button>
        </div>
    );
}

export default LogIn;
